"use strict";

var _number = require("./number");

describe("assertUint64", () => {
  it("should test the assertUint64 function", () => {
    expect(() => (0, _number.assertUint64)(BigInt(0))).not.toThrow();
    expect(() => (0, _number.assertUint64)(BigInt(-1))).toThrow();
    expect(() => (0, _number.assertUint64)(_number.MAX_REVISION)).not.toThrow();
    expect(() => (0, _number.assertUint64)(_number.MAX_REVISION + BigInt(1))).toThrow();
  });
});